.jnpf-release-modal {
  >>> .el-dialog {
    .el-dialog__body {
      height: 430px;
      padding: 12px 55px;
    }
  }
  .release-main {
    margin-top: 20px;
    display: flex;
    justify-content: space-between;
    .item {
      position: relative;
      width: 215px;
      height: 80px;
      cursor: pointer;
      border: 1px solid #dcdfe6;
      border-radius: 6px;
      text-align: center;
      padding-top: 0;
      display: flex;
      align-items: center;
      justify-content: center;
      color: #606266;
      &.active {
        border-color: #1890ff;
        color: #1890ff;
        box-shadow: 0 0 6px rgba(6, 58, 108, 0.1);
        .item-icon {
          border-color: #1890ff;
        }
        .icon-checked {
          display: block;
        }
      }
      .item-icon {
        display: inline-block;
        width: 28px;
        height: 28px;
        border: 1px solid #606266;
        line-height: 40px;
        margin: 0 8px 0 0 !important;
        font-size: 16px;
        text-align: center;
        border-radius: 50%;
        line-height: 26px !important;
        border-width: 1px !important;
      }
      .item-title {
        font-size: 16px;
        font-weight: 400;
      }
      .icon-checked {
        display: none;
        width: 18px;
        height: 18px;
        border: 18px solid #1890ff;
        border-left: 18px solid transparent;
        border-top: 18px solid transparent;
        border-bottom-right-radius: 4px;
        position: absolute;
        right: 0px;
        bottom: 0px;

        i {
          font-size: 16px;
          position: absolute;
          top: 0;
          left: -2px;
          color: #fff;
        }
      }
    }
  }
  .release-form-main {
    margin-top: 20px;
    display: flex;
    justify-content: space-between;
    .el-form-item {
      width: 215px;
    }
  }
}
.release-title {
  font-size: 16px;
  padding-top: 10px;
  font-weight: bold;
}
